import React from 'react';
import ArtistTrackerApi from './api';

function EventList() {
    const artists = [{id: 'K8vZ917G4u0',
                      name: 'Luke Bryan'}]

    return(
        <div>
            <ul>
                {artists.map(a => {
                   return <li>{a.name}</li>
                })}
            </ul>
        </div>
    )
}

export default EventList;
